ound-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">6</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=6\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=7\"><img alt=\"怎样注册淘宝网购物帐号？\" src=\"http://f.hiphotos.baidu.com/exp/scrop=50/sign=8e331726ddc451daf2a84bb4c6c06756/1b4c510fd9f9d72af5bf9f65d42a2834359bbbeb.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">7</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=7\"></a>\r\n		</li>\r\n	</ul>\r\n	<div class=\"clear\">\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<div class=\"exp-content-listblock\">\r\n			<div class=\"content-listblock-text\">\r\n				随着生活水平的提高，电子商务的崛起，越来越多的消费者选择网上购物，足不出户就可以淘遍世界各地的商品，不但简单方便、而且物美价廉。但对于很多没有接触过网上购物的消费者来说，网上购物还是存在着许多疑惑，比如说如何注册购物网站帐号？如何在购物网站进行网上购物？如何挑选自己喜欢的商品？等等。接下来以淘宝网为例向大家图文讲解这一系列的问题，今天，先从《如何注册淘宝网购物帐号》讲起：\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		工具\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					一台可以链接网络的计算机\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		步骤/方法\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					登录购物网站：以淘宝网为例：http://www.taobao.com\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					点击免费注册帐号按钮，如下图<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=1\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://b.hiphotos.baidu.com/exp/w=500/sign=af05319cb31c8701d6b6b2e6177e9e6e/6c224f4a20a4462388812a1a9822720e0cf3d77b.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-1\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					选择一种注册方式，手机号码注册或邮箱注册，如下图<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=2\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://f.hiphotos.baidu.com/exp/w=500/sign=4b89a19dad6eddc426e7b4fb09dab6a2/eac4b74543a982268a81a45f8a82b9014a90eb02.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-2\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-4\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					填写注册信息，并提交注册，如下图<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=3\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://a.hiphotos.baidu.com/exp/w=500/sign=c65d19847cd98d1076d40c31113eb807/ca1349540923dd54bece2810d109b3de9c82480d.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-3\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-5\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					发送邮箱至您注册时所填写的邮箱内，如下图提示<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=4\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://h.hiphotos.baidu.com/exp/w=500/sign=22f23f7de5dde711e7d243f697eecef4/b03533fa828ba61e5f4347574134970a304e591d.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-4\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-6\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					登录邮箱，查看收到的激活邮件<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=5\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://f.hiphotos.baidu.com/exp/w=500/sign=866b0d0d43a98226b8c12b27ba83b97a/0bd162d9f2d3572c7c7013a48a13632762d0c33c.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-5\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-7\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					打开激活邮件后，可以看到来自淘宝网的帐号激活邮件内容，点击完成注册即可激活帐号<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=6\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://h.hiphotos.baidu.com/exp/w=500/sign=0456133f3912b31bc76ccd29b6193674/908fa0ec08fa513d514ce3a63d6d55fbb3fbd9e0.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-6\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-8\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					最后完成注册，可以登录帐号进行会员的一些操作<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/ff411625638b5412e482373a.html?picindex=7\" target=\"_self\"><img class=\"exp-image-default\" alt=\"怎样注册淘宝网购物帐号？\" src=\"http://f.hiphotos.baidu.com/exp/w=500/sign=9f37d891f2d3572c66e29cdcba126352/1b4c510fd9f9d72af5bf9f65d42a2834359bbbeb.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-7\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		注意事项\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					帐号注册完毕，可以进入帐号完善一下个人的资料。\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>', '2013-01-05 03:39:26', '0', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('19', '19', '怎么售后', '', '', '', '', '怎么售后怎么售后怎么售后', '2013-01-05 03:40:28', '4', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('20', '17', '如何申请拍拍账号', '', '', '', '', '如何申请拍拍账号， 其实就是您的qq账号，直接用qq登录拍拍就可以了。', '2013-06-11 18:59:02', '0', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('21', '19', '网购被骗怎么办', '', '', '', '', '<pre id=\"best-content-669503294\" class=\"best-text mb-10\">网购被骗是很正常的一件事儿，不过不知道以前有过网购经验么？如果没有我还是提醒您几点：第一，选择诚信度比较高的购物网站，如淘宝、百度有啊、当当等知名的网购网站，然后在其中选择信誉比较好的商家；第二，不要贪便宜，便宜无好货，好货不便宜，在网上你100能买到200-300的东西，但是绝对买不到2000-3000的东西；第三，有自己的主见，不要人让你干嘛你就干嘛，记得充分了解了网购的流程以及注意事项后再进行操作；第四，当你觉得被骗时，一定不要慌张，大型的网购网会有维权、投诉等功能，数额较大的选择报警。 纯手打，希望能帮到你</pre>', '2013-06-11 18:59:37', '0', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('22', '16', '网购怎么退货', '', '', '', '', '<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<div class=\"exp-content-listblock\">\r\n			<div class=\"content-listblock-text\">\r\n				<p>\r\n					当买家收到了货物，但是由于商品与卖家网上描述不符或者其他商品问题以及其他交易问题，这时网购怎么退货？可以在交易超时前及时申请“买家收到货但是需要退货”类型的退款\r\n				</p>\r\n			</div>\r\n			<div class=\"content-listblock-media\">\r\n				<div class=\"content-listblock-image\">\r\n					<img class=\"exp-image-default\" alt=\"网购怎样退货\" src=\"http://d.hiphotos.baidu.com/exp/w=500/sign=2c6f21711a4c510faec4e21a50582528/30adcbef76094b360784e454a3cc7cd98d109d71.jpg\" />\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		工具/原料\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						买到不如意的商品需要退货\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list list-item-2\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						熟悉网购流程\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list list-item-3\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						有网上银行 支付宝账号\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		步骤/方法\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						登录“我的淘宝”“已买到的宝贝” 找到相关交易，点击对应的“退款”按钮，操作申请退款（请务必在页面提示的超时时间之前进行退款申请，一般平邮30天，快递10天，虚拟物品3天，自动发货商品1天）。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						点击退款后选择“已经收到货”“我需要退货”注意：你没有收到货请不要选择此项，不管对方什么理由也不要选择这个。淘宝提醒您：如果在您实际没有收到货的情况下点击此按钮，将导致钱货两空。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						“我愿意向卖家支付”后面的框里需要给卖家支付多少钱就填多少，比如您的货一共是25元，现在协商给卖家20元，那么你就填20元，卖家确认了就支付给卖家20元，给买家退5元。如果要求全部退款，不需要给卖家钱就填写 0 就可以了！然后填写退款说明，输入您的支付宝账户支付密码，立即申请退款。这时网购退货流程已经进行了快要一半了。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-4\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						买家申请退款后是退款协议等待卖家确认中，可以查看现在买家的退款状态。卖家有15天的时间来处理退款协议。如超时未处理，退款协议将生效，交易进入退货流程。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-5\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						如果卖家同意退款协议，需选择退货地址，保存并通知买家退货，买家需及时填写发货方式及选择物流公司，完成退货。一般系统会给买家14天时间来进行退货操作（具体超时时间请查看退款页面的超时提醒），如果未按时退货，退货退款协议将取消，系统将会把交易款项打款到卖家账户。这个具体到每一步的网购退货流程是不是很好的帮你解决了网购怎么退货的难题？\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-6\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						如果卖家不同意退货退款协议，交易状态会变成“卖家不同意协议，等待买家修改”，此时系统给买家的超时一般是15天，如需再次申请退款请再次操作。如果双方就退款协议问题反复申请拒绝不能达成一致，“客服介入状态”将变成“需要客服介入”，淘宝客服将在退款申请之日起30天内来介入帮助双方协商处理。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-7\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						如果买家选择快递发退货后，卖家可以在10天内来确认收到退货（具体超时可以查看退款页面的超时提醒），交易状态将变成“买家已退货，等待卖家确认收到退货”。若卖家同意退款协议，退款成功，你的网购退货流程就差不多完成了。若卖家拒绝退款协议，请卖家详细说明理由，且积极联系买家协商。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-8\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						如果买家退货后卖家不同意退款，双方无法协商成功，“客服介入状态”将变成“需要客服介入”，淘宝客服将在退款申请之日起30天内来介入帮助双方协商处理。此时，整个网购退货流程才算正式结束，那些不知道网购怎么退货的买家可要好好学下哦。\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		注意事项\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						在退货前先与卖家协商 达成一致\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>', '2013-06-11 19:01:18', '0', '0', '0', '0', '', '', '');
INSERT INTO `td6_help` VALUES ('23', '16', '网购怎么换货', '', '', '', '', '<div class=\"brief-album-enter\" style=\"font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"brief-album-enter-text\" style=\"background-color:#FCFCFC;color:#999999;font-size:12px;\">\r\n		步骤\r\n	</div>\r\n	<ul class=\"album-filmstrip\" id=\"album-filmstrip\" style=\"margin-left:0px;\">\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=1\"><img alt=\"淘宝怎么换货\" src=\"http://g.hiphotos.baidu.com/exp/scrop=50/sign=5e0b47e2baa1cd1101e8357fc92ffdcc/4e4a20a4462309f736850ec0720e0cf3d6cad67e.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">1</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=1\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=2\"><img alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/scrop=50/sign=63982ae34a90f60300eedb18492f862b/7dd98d1001e93901c8252bec7bec54e736d19639.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">2</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=2\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=3\"><img alt=\"淘宝怎么换货\" src=\"http://h.hiphotos.baidu.com/exp/scrop=50/sign=2abca531d539b600499048e8996d001a/d53f8794a4c27d1eed699d161bd5ad6edcc43890.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">3</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=3\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=4\"><img alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/scrop=50/sign=fd7c13e819d8bc3ec2564195f2b6932e/0b7b02087bf40ad1f3246131572c11dfa8ecce24.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">4</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=4\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=5\"><img alt=\"淘宝怎么换货\" src=\"http://c.hiphotos.baidu.com/exp/scrop=50/sign=de9ea74a5edf8db1b8703b3b791ee864/b21c8701a18b87d6a5810dcd070828381e30fd25.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">5</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=5\"></a>\r\n		</li>\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<a href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=6\"><img alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/scrop=50/sign=2fcdef6b9e510fb37c4730c8a90efda5/d439b6003af33a872050a1c8c65c10385343b527.jpg\" style=\"height:50px;width:50px;\" /></a><span class=\"thumb-item-index\" style=\"background-color:#4FB532;font-size:11px;font-weight:bold;color:#FFFFFF;\">6</span><a class=\"thumb-item-curtain\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=6\"></a>\r\n		</li>\r\n	</ul>\r\n	<div class=\"clear\">\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<div class=\"exp-content-listblock\">\r\n			<div class=\"content-listblock-text\">\r\n				<p>\r\n					淘宝网是一个鱼龙混杂的市场，在淘宝购物难免会买到一些不如意的商品，怎样正确的换货/退货以保障自己的利益显得十分重要。掌握淘宝的相关规定，认知换货的风险，从而才可以避免不必要的损失。\r\n				</p>\r\n			</div>\r\n			<div class=\"content-listblock-media\">\r\n				<div class=\"content-listblock-image\">\r\n					<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=1\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://g.hiphotos.baidu.com/exp/w=500/sign=2d0325fe8701a18bf0eb124fae2d0761/4e4a20a4462309f736850ec0720e0cf3d6cad67e.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-1\" style=\"background-color:transparent;\"></span></a>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		方法/步骤\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						在淘宝购物后，当收到的商品不满意时，登入PC版旺旺联系卖家，说明商品不满意要求换货。不建议使用手机旺旺联系卖家，用PC版旺旺联系卖家可以方便取证，如果交易发生争端，旺旺的聊天记录将会是你需要的有力证据。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=2\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/w=500/sign=cc3747c82834349b74066e85f9eb1521/7dd98d1001e93901c8252bec7bec54e736d19639.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-2\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						卖家同意换货后提供退换货地址。根据地址将商品寄回给卖家。一般卖家会要求不得使用平邮和到付，用一般快递寄回即可。切记保留寄回商品的快递底单，如果发生争端，这将是能证明你已经寄回商品的证据。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						卖家收到退回的商品后重新发货。如果卖家迟迟不再发货，而系统又将到期自动确认收货，可在已买到的宝贝中打开订单详情申请延长收货时间。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=3\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://h.hiphotos.baidu.com/exp/w=500/sign=a3f042baccbf6c81f7372ce88c3fb1d7/d53f8794a4c27d1eed699d161bd5ad6edcc43890.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-3\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-4\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						签收换回的商品，完成换货，再处理退款。<br />\r\n邮资处理：如果是买家原因（非商品质量问题）换货，由买家自行承担所有换货的运费。其中，如果是卖家包邮的商品，买家只需自行承担寄回运费；如果是非商家包邮商品，买家还需承担卖家再次发货运费，一般由买家支付宝转账给卖家。个别大品牌承诺购物享受免费退换货除外。<br />\r\n如果是商品质量问题或收到的货物与网上描述不符而导致的换货，由卖家承担所有换货的运费。其中，买家寄回商品先行垫付的邮资可以通过申请退运费而退还。也有卖家会直接冲支付宝转账完成退还邮资，也可以接受。\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		申请退运费\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						通过PC版淘宝进入“已买到的宝贝”。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=4\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/w=500/sign=e8cc99b7b319ebc4c0787699b224cf79/0b7b02087bf40ad1f3246131572c11dfa8ecce24.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-4\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						找到换货了的商品订单，点击“退款/退货”。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=5\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://c.hiphotos.baidu.com/exp/w=500/sign=4a6b42a1ad4bd11304cdb7326aada488/b21c8701a18b87d6a5810dcd070828381e30fd25.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-5\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						在退款界面选择“已收到货”<br />\r\n是否退货：选择“无需退货”<br />\r\n需要退款金额：输入先行垫付的邮资金额<br />\r\n退款原因：选择“退运费”<br />\r\n退款说明：可写可不写<br />\r\n上传凭证：如写有快递邮资的快递回单照片、证明卖家承担邮资的聊天记录等<br />\r\n提交退款申请，等待卖家确认退款完成运费退还。邮资处理完成后，完成整个换货流程，接下来正常确认收货、评价。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<a class=\"exp-image-wraper  image-loaded\" href=\"http://jingyan.baidu.com/album/fec7a1e537156b1190b4e7c7.html?picindex=6\" target=\"_self\"><img class=\"exp-image-default\" alt=\"淘宝怎么换货\" src=\"http://b.hiphotos.baidu.com/exp/w=500/sign=ef97cd0c3d6d55fbc5c676265d234f40/d439b6003af33a872050a1c8c65c10385343b527.jpg\" /><span class=\"exp-album-enter\" id=\"exp-album-enter-6\" style=\"background-color:transparent;\"></span></a>\r\n					</div>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		注意事项\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						只有支持“7天无理由退换货服务”的商品支持换货，仅支持“消费者保障服务”的商品如需换货可采取退货然后再买的途径。个别大品牌承诺购物享受免费退换货除外。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list list-item-2\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						如果卖家拒绝换货，不提供换货的寄回地址，可直接申请退款/退货，卖家拒绝退货则申请淘宝小二介入解决问题；卖家同意退货则会系统自动提供卖家的收货地址，中途有任何问题都可以申请淘宝小二介入解决问题。总之，换货不成就退货。\r\n					</p>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list list-item-3\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						7天无理由退换货服务要求自签收货物之日起7天内，在不影响2次销售的情况下，买家可以无理由向卖家提出退换货要求。过期无法享受无理由退换货服务。\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>', '2013-06-11 19:01:49', '0', '0', '0', '0', '', '', '');
INSERT INTO `td6_help` VALUES ('24', '16', '支付宝安全么', '', '', '', '', '支付宝，是支付宝公司针对网上交易而特别推出的安全付款服务，其运作的实质是以支付宝为信用中介，在买家确认收到商品前，由支付宝替买卖双方暂时保管货款的一种增值服务。&nbsp;<br />\r\n支付宝交易付款，收货满意后卖家才能拿钱，100%安全。&nbsp;<br />\r\n・ 支付宝认证维护网络诚信，奠定了支付宝安全交易的基石。&nbsp;<br />\r\n・ 支付宝拥有先进的反欺诈和风险监控系统，有效降低交易风险。&nbsp;<br />\r\n・ 支付宝与国内各大银行建立的战略合作伙伴关系，与银行无缝对接。&nbsp;<br />\r\n・ 支付宝免费短信提醒，任何资金的变动都立刻知道，采取行动。&nbsp;<br />\r\n・ 支付宝提出“你敢付，我敢赔”服务承诺，使用支付宝购物，受到损失将获得全额赔付，让您购物没有后顾之忧。&nbsp;', '2013-06-11 19:03:31', '0', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('25', '19', '支付宝账户被盗怎么办', '', '', '', '', '1、支付宝防止账户被盗措施 （1）推出快捷支付方式&nbsp;<br />\r\n支付宝联合十几家银行推出信用卡快捷支付服务。快捷支付是支付宝最新推出的网上支付服务。&nbsp;<br />\r\n除了便捷性之外，快捷支付服务还将有效增强网上支付的安全性。支付宝表示，用户使用快捷支付如果遭遇资金损失，支付宝将全额给予赔付。 通过支付宝快捷支付，用户网上支付不需要开通网银，只要根据提示输入卡号等必要信息就可以非常简单、安全地完成网上支付，并且额度以信用卡本身的额度为准，不受网银额度下调等限制。消费者使用快捷支付付款无需任何手续费。在给用户提供便捷的同时，支付宝和银行联手启动了包括信用卡资料匹配、短信动态口令在内的多重安全认证规则为用户保驾护航。&nbsp;<br />\r\n（2）安全网购浏览器&nbsp;<br />\r\n支付宝与搜狗浏览器开始跨界合作，推出业界第一款安全网购浏览器，浏览器本身就已经内置了支付宝控件，与之前的“安全浏览器”不同的是，该款产品还特别针对网购安全做了有关钓鱼木马、页面安全漏洞等方面的优化，并与淘宝、支付宝的安全数据库进行实时对接，确保对恶意网站的精准拦截，保障交易支付的安全。 （3）支付宝网站自身的安全保护措施&nbsp;<br />\r\n①支付宝网站采用了先进的128位SSL加密技术，确保用户在支付宝页面上输入的任何信息可以安全传送到支付宝，而不用担心有人会通过网络窃取您的敏感信息。&nbsp;<br />\r\n②支付宝账户有两个密码，一个是登录密码，用于登录账户，查看账目等一般性操作；另一个是支付密码，凡是牵涉到资金流转的过程，都需要使用支付密码。缺少任何一个密码，都不能使资金发生流转。同时，同一天内系统只允许密码输入出错两次，如果第三次密码输入出错，系统将自动锁定该账户，只有等三个小时后才会自动解除锁定。 ③支付宝账户设置了密码保护问题。 用户可以设置密码保护问题和答案，在用注册邮箱找回支付宝账户密码时，如果密码保护问题及答案错误，将无法找回密码。减少了邮箱被盗导致泄漏支付宝账户密码的危险。 ④支付宝账户提现时，系统将检查用户登记的银行账户姓名是否与其认证姓名一致，否则将不予提现。&nbsp;<br />\r\n⑤支付宝账户设置变动手机短信通知服务。&nbsp;<br />\r\n在修改密码、使用支付宝账户余额付款、取回密码、申请提现、更新登记的银行账号、修改Email地址等操作的时候，用户会收到手机短信通知。如果用户收到的操作提示短信不是本人进行的操作，可以及时检查账户并联系支付宝，以保护账户安全。&nbsp;<br />\r\n⑥作为协议的一部分，用户支付宝账户中的资金，将不会用于指定用途以外的任何方面。 ⑦如果用户在支付宝账户中的资金来源是合理合法的，那么除非本人或者生效法律文书的指示，用户的支付宝账户中的资金将是不可逆转的。 2、用户自身防止账户被盗措施&nbsp;<br />\r\n（1）重视淘宝网以及其他网上资金账户与密码的安全，当做保险箱钥匙来对待处理。要保持在各个网站上的账户 与密码的独立。&nbsp;<br />\r\n（2）及时开通淘宝网最新推出的核心安全产品二次验证功能。&nbsp;<br />\r\n（3）对于一些不熟悉的网站，填写个人信息时要谨慎，如涉及相关网络支付账户，尽量不要填写。&nbsp;<br />\r\n（4）推荐使用数字证书、宝令、口令卡等安全产品来提升安全等级，避免因电脑中了木马导致账户被盗。&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n（5）确保在淘宝网上的账号与支付宝账号的密码的不同，以免一个账号被盗引发同时被盗 （6）经常登录自己注册过淘宝及支付宝的邮箱，以免长期不登陆被提供商收回，从而很可能被骗子抢注盗取账号。<br />', '2013-06-11 19:07:26', '0', '0', '0', '1', '', '', '');
INSERT INTO `td6_help` VALUES ('26', '18', '淘宝网购流程', '', '', '', '', '<p>\r\n	1、注册 \r\n如果您还没有在淘宝上注册，请先注册(您应该有自己的电子邮箱吧，没有的话申请一个先)。点击免费注册，在注册页面填好相关信息就可以，然后再到您填好的电子邮箱中收信，确认，就可以进行下一步了。这个动作比较很简单哦。\r\n</p>\r\n<p>\r\n	&nbsp;2、注册支付宝 \r\n这一步有点麻烦，但是您需要有耐心哦。注册支付宝实际上是一劳永逸的事情，可以大大减少您在网上购物的风险，因此也可以给您的网上购物生活带来很大的乐趣哦，说不定您以后会爱上它的。 \r\n好，看仔细了，我要开始做动作了。 \r\n刚才我们注册确认之后弹出一个页面，赶快找到第四个图标，象一个盾牌的图标，那就是支付宝的图标，它就是给您挡风险的哦，旁边提示您“点此激活支付宝帐户”，OK，那我们赶快点击它激活我们的支付宝帐户吧。 \r\n点击之后，又弹出一个页面，这时候您输入您在注册淘宝会员时设置的密码，就进入了支付宝确认的最后一步了。 \r\n进入确认页面后，填上您的相关信信息，您的支付宝确认就完成了。但是，您一定要记住您刚才输入的密码。密码有两种：登陆密码和支付密码，前者是您登陆支付宝时使用，后者是您在购物付款时使用，当然为了省事，您的两个密码可以设置相同。这个时候您点击下面的“保存并启用支付宝”就进入了支付宝管理页面，您还可以去领取一个红包哦。关于支付宝，还有很多功能，您可以以后慢慢去摸索，JJ要教您开始下一个动作了哦。&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp;3、注册网上银行 \r\nJJ以工行为例，教大家开通网上银行，来，让我们先上工行的首页：点击在首页的左上角“个人网上银行登陆”的下面“自助注册”，就可以开始注册。如果注册不了，并且提示您安装什么东西（对不起，我已经注册很久，忘了是要装什么东东）您就装吧，装完再注册，这里也要设置工行的登陆密码和支付密码，请千万要记住密码，忘记了后果很严重哦（登陆密码输错三次您就要带身份证到银行重置密码，忘了支付密码就不能进行B2C的交易。建行农行都要到银行签约才能进行网上支付，比较麻烦，因此这里不做介绍。\r\n</p>\r\n<p>\r\n	&nbsp;好，经过这三步，准备工作就做好了，好，let’s go，让我们去淘宝购物吧！大家是不是都等不及了？\r\n</p>\r\n<p>\r\n	&nbsp;xx当，购物开始，大家注意了，购物操正式开始。\r\n</p>\r\n<p>\r\n	&nbsp;1、选择宝贝 \r\n也就是淘自己喜欢的宝贝，打开淘宝网，在首页右上角点击“我要买”，再在您感兴趣的分类中挑选自己喜欢的宝贝。选中了吗？选中了我们就开始下面的步骤。 \r\n您选中了宝贝后点宝贝的图片，就会出现宝贝所在的页面。如果您实在太喜欢宝贝了，没有任何问题要向卖家咨询，您就可以点立即购买。如果您有问题要咨询，那么先登陆淘宝后，可以直接在该页下方的空白处写下您的问题并确认，这样卖家在看到您的问题后回复您（当然如果卖家迟迟不回复，建议您不要向这样的卖家买东西）。您若想要了解卖家的信用度，可以点右边“查看信用评价”或者直接点心心或者钻石就可以看到信用评价；若您还想了解卖家的其他宝贝就点右边的“逛逛掌柜的店铺”，这样您就进了卖家的店铺。\r\n</p>\r\n<p>\r\n	&nbsp;2、确认购买 \r\n言归正传，当您点了立即购买后，看到一个页面，上面写着三步：1、确认购买，2、付款，3、确认收货，那么您首先要确认购买，即您要先和卖家确认颜色式样等宝贝信息后，确定您所需要的宝贝有货后，在空白处填上相关信息特别是要准确填写您的收货地址，然后点确认.这就是您把宝贝拍下来了。\r\n</p>\r\n<p>\r\n	&nbsp;3、付款 \r\n拍下来后，就可以付款了。如果您还需要和掌柜确认颜色款式等，最好先确认清楚了再付款。付款的时候，您若要选择支付宝付款，那么就请点“支付宝付款”。您可以先登陆支付宝帐号对支付宝进行充值，不充值也没有关系。点完“支付宝付款”后，选择您所开通的网上银行，就会出现银行的界面（以工行为例），然后登陆银行，接着输入支付密码就付款成功了。\r\n</p>\r\n<p>\r\n	&nbsp;4、确认收货 \r\n付款之后您就等着卖家发货，卖家发完货会通知淘宝，淘宝会通知您的，您可以在淘宝首页上点“我的淘宝”，然后点左边的“已经买到的宝贝”，查看卖家是否发货，您收到货并且觉得满意也是用同样的方法进到“已经买到的宝贝”点“确认收货”，只有您确认收货后支付宝才放款给卖家，是不是觉得很安全？当然如果您不确认也不申请退款，一段时间后支付宝也会把款放给卖家，但是您可能得到的是卖家的差评咯，然后您再点“评价”就可以给卖家评价了。\r\n</p>', '2013-06-11 19:08:00', '0', '0', '0', '0', '', '', '');
INSERT INTO `td6_help` VALUES ('27', '18', '拍拍网购流程', '', '', '', '', '<div class=\"brief-album-enter\" style=\"font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<div class=\"brief-album-enter-text\" style=\"background-color:#FCFCFC;color:#999999;font-size:12px;\">\r\n		步骤\r\n	</div>\r\n	<ul class=\"album-filmstrip\" id=\"album-filmstrip\" style=\"margin-left:0px;\">\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<span><span style=\"line-height:16px;\"><b><br />\r\n</b></span></span> \r\n		</li>\r\n	</ul>\r\n	<div class=\"clear\" style=\"font-size:14px;\">\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<div class=\"exp-content-listblock\">\r\n			<div class=\"content-listblock-text\">\r\n				<p>\r\n					腾讯旗下的购物网站，对于刚开始接触网络购物的同学来说还比较陌生，跟着我来学一下如何在拍拍网上网购吧。\r\n				</p>\r\n				<p>\r\n					<br />\r\n				</p>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		工具/原料\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ul class=\"exp-content-unorderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list list-item-1\" style=\"margin-left:auto !important;background-color:transparent;\">\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						能上网的电脑一台\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		步骤/方法\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						点击QQ界面顶部的“拍拍购物”按钮。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						出现一个小的弹出框，点击拍拍网的LOGO就可以进入拍拍网了，而且还会用QQ账号自动登录哦。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						然后就出现了拍拍网的主页。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-4\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						可以通过网页左上角的商品分类找到自己想要买的物品。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-5\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						这里我们以买iPhone4s为例。首先点击“数码家电”然后点击“iPhone4s”。就进入了如下界面。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-6\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						这个时候要根据价格，商家信誉，用户评价等选择适当的卖家进行购物网。这里我们假定已经选定了第一家作为理想的卖家。点击该商家后出现如下图所示的商家界面。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-7\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						然后选择版本，颜色和内存等商品信息。然后点击“立即购买”按钮。出现下图所示的确认信息界面。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-8\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						把所有的购物信息看过一遍无误后，点击“确认提交订单”按钮。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-9\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						这个时候就会出现“付款到财付通”的界面。根据自己的实际情况选择支付方式。\r\n					</p>\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-10\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					<p>\r\n						然后就等待商家发货，快递到达后先开箱验货，无误后签收。然后再次登录拍拍网“确认收货”，最后对卖家进行评价。整个购物就完成了。\r\n					</p>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>', '2013-06-11 19:08:25', '0', '0', '0', '0', '', '', '');
INSERT INTO `td6_help` VALUES ('28', '18', '京东网购流程', '', '', '', '', '<div class=\"brief-album-enter\" style=\"font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<div class=\"brief-album-enter-text\" style=\"background-color:#FCFCFC;color:#999999;font-size:12px;\">\r\n		步骤\r\n	</div>\r\n	<ul class=\"album-filmstrip\" id=\"album-filmstrip\" style=\"margin-left:0px;\">\r\n		<li class=\"thumb-item\" style=\"margin-left:7px !important;background-color:initial;\">\r\n			<span><span style=\"line-height:16px;\"><b><br />\r\n</b></span></span>\r\n		</li>\r\n	</ul>\r\n	<div class=\"clear\" style=\"font-size:14px;\">\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<div class=\"exp-content-listblock\">\r\n			<div class=\"content-listblock-text\">\r\n				京东商城购物流程是怎样的？我为大家分享一下我在京东商城购物的流程。<br />\r\n			</div>\r\n			<div class=\"content-listblock-media\">\r\n				<div class=\"content-listblock-image\">\r\n					<br />\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"exp-content-block\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<h2 class=\"exp-content-head\" style=\"margin-left:0px;font-size:16px;font-family:\'microsoft yahei\';\">\r\n		步骤/方法\r\n	</h2>\r\n	<div class=\"exp-content-body\" style=\"text-align:justify;\">\r\n		<ol class=\"exp-conent-orderlist\" style=\"margin-left:0px;\">\r\n			<li class=\"exp-content-list-under20 list-item-1\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					查找商品。招安分类浏览或直接搜索商品<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-2\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					放入购物车。带着商品去结算或者继续购物。<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-3\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					提交订单。提交订单时需要选择配送方工和支付方工。<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-4\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					查看订单状态。准备收货或自己去附近的京东提货点提货。<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n			<li class=\"exp-content-list-under20 list-item-5\" style=\"margin-left:0px;\">\r\n				<div class=\"list-icon\" style=\"background-color:initial;\">\r\n				</div>\r\n				<div class=\"content-list-text\">\r\n					收货后评价。收到货品后需要确认商品没有损坏，接着写商品评价。<br />\r\n				</div>\r\n				<div class=\"content-list-media\">\r\n					<div class=\"content-list-image\">\r\n						<br />\r\n					</div>\r\n				</div>\r\n			</li>\r\n		</ol>\r\n	</div>\r\n</div>', '2013-06-11 19:08:56', '0', '0', '0', '1', '', '', '');
